package leetcode;

import org.junit.Assert;
import org.junit.Test;

/**

 '?' Matches any single character.
 '*' Matches any sequence of characters (including the empty sequence).

 The matching should cover the entire input string (not partial).

 The function prototype should be:
 bool isMatch(const char *s, const char *p)

 Some examples:
 isMatch("aa","a") → false
 isMatch("aa","aa") → true
 isMatch("aaa","aa") → false
 isMatch("aa", "*") → true
 isMatch("aa", "a*") → true
 isMatch("ab", "?*") → true
 isMatch("aab", "c*a*b") → false

 */
public class WildcardMatching {
    boolean matchFound ;
    boolean[][] inspectedCombinations;

    public boolean isMatch(String s, String p) {

        //check if enough
        int count = 0;
        for(int i = 0;i< p.length();i++){
            if(p.charAt(i) != '*') count++;
        }
        if(count > s.length()) return false;

        matchFound = false;
        inspectedCombinations = new boolean[s.length() + 1][p.length() + 1];


        isMatch(s, 0, p, 0);
        return matchFound;
    }

    public void isMatch(String str, int sStartAt,  String pattern, int pStartAt) {
        if (matchFound) return;
        if (isInspected(sStartAt, pStartAt)) return;
        setInspected(sStartAt,pStartAt);

        if (sStartAt == str.length()) {
            if (pStartAt == pattern.length() || containsOnlyStart(pattern, pStartAt)) {
                matchFound = true;
                return;
            } else {
                return;
            }
        } else if (pStartAt == pattern.length()) {
            return;
        } else {
            switch (pattern.charAt(pStartAt)){
                case '?' : {
                    isMatch(str, sStartAt +1, pattern, pStartAt+1);
                    break;
                }
                case '*' : {
                    isMatch(str, sStartAt + 1, pattern, pStartAt + 1);
                    isMatch(str, sStartAt + 1, pattern, pStartAt);
                    isMatch(str, sStartAt, pattern, pStartAt + 1);

                    break;
                }
                default : {
                    while (sStartAt < str.length() && pStartAt < pattern.length() && pattern.charAt(pStartAt) != '?' && pattern.charAt(pStartAt) != '*') {
                        setInspected(sStartAt,pStartAt);
                        if (str.charAt(sStartAt) == pattern.charAt(pStartAt)) {
                            sStartAt++;
                            pStartAt++;
                        } else {
                            break;
                        }
                    }
                    isMatch(str, sStartAt,  pattern, pStartAt);
                    break;
                }
            }
        }
    }

    public boolean containsOnlyStart(String pattern, int pStartAt) {
        for (int i = pStartAt; i < pattern.length(); i++) if (pattern.charAt(i) != '*') return false;
        return true;
    }

    public boolean isInspected(int sStartAt, int pStartAt) {
        return inspectedCombinations[sStartAt][pStartAt];
    }

    public void setInspected(int sStartAt, int pStartAt) {
        inspectedCombinations[sStartAt][pStartAt] = true;
    }


    @Test
    public void test() {
        Assert.assertFalse(isMatch("aa", "a"));
        Assert.assertTrue(isMatch("aa", "aa"));
        Assert.assertTrue(isMatch("aa", "*"));
        Assert.assertTrue(isMatch("aa", "a*"));
        Assert.assertTrue(isMatch("aa", "?*"));
        Assert.assertTrue(isMatch("a", "*?*"));
        Assert.assertFalse(isMatch("aab", "c*a*b"));
        Assert.assertTrue(isMatch("aaaabaaaabbbbaabbbaabbaababbabbaaaababaaabbbbbbaabbbabababbaaabaabaaaaaabbaabbbbaababbababaabbbaababbbba", "*****b*aba***babaa*bbaba***a*aaba*b*aa**a*b**ba***a*a*"));
        Assert.assertFalse(isMatch("",
                                  "**"
        ));
    }
}
